Error 141:  Invalid PUBLIC definition
 
Error 141 occurs when loading .OBJ files with {$L &lt;name&gt;}.
 
A symbol declared as PUBLIC in the .OBJ file is already
in the symbol table from a different definition. A name
collision has occurred.
 
Change one of the names.
